import React from 'react';
import bg1 from '../images/bg-1.jpg'
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faShoppingBasket,faSearch,faEllipsisH } from "@fortawesome/free-solid-svg-icons";

const Header = ({ }) => {
  return (
    <div className='h-[1000px] overflow-auto py-[3%] px-[4%]' style={{
      background:`linear-gradient(rgba(0, 0, 0, 0.2), rgba(0, 0, 0, 0.2)),url(${bg1})`,
      backgroundPosition: "center",
      backgroundSize: "cover",
    }} >
     <div className='flex justify-between text-white' >  
      <div>
        <h2 className='font-AbrilRegular' >MIND HILL</h2>
      </div>
      <div className='flex justify-between w-[45%]  font-gorditaMedium ' >

          <h4>HOME</h4>
          <h4>PAGES</h4>
          <h4>SHOP</h4>
          <h4>PORTFOLIO</h4>
          <h4>BLOG</h4>
          <div className='bg-[#FFA27E]' >
          <FontAwesomeIcon icon={faShoppingBasket}  />
         </div>
         <div>
         <FontAwesomeIcon icon={faSearch}  />
         </div>
         <div>
         <FontAwesomeIcon icon={faEllipsisH}  />
         </div>

      </div>
     </div>

    </div>
  );
};

export default Header;
